 // Check for valid color\n  @if "color" != type-of($color) {\n    @warn \'The requested color - "\' + $color + \'" - was not recognized as a Sass color value.\';\n\n    @return null;\n  }\n\n  @if map-has-key($icons, $icon) {\n    $icon: map-get($icons, $icon);\n    $color-placeholder: "%%COLOR%%";\n    $icon: str-replace($icon, $color-placeholder, $color);\n  } @else {\n    @warn \'The requested icon - "\' + $icon + \'" - is not defined in the $icons map.\';\n\n    @return null;\n  }\n\n  // Add missing namespace\n  @if not str-index($icon, xmlns) {\n    $icon: str-replace(\n      $icon,\n      "<svg",\n      \'<svg xmlns="http://www.w3.org/2000/svg"\'\n    );\n  }\n\n  // Chunk up string in order to avoid "stack level too deep" error\n\n  $encoded: "";\n  $slice: 2000;\n  $index: 0;\n  $loops: ceil(math.div(str-length($icon), $slice));\n\n  @for $i from 1 through $loops {\n    $chunk: str-slice($icon, $index, $index + $slice - 1);\n\n    // Encode\n    $chunk: str-replace($chunk, \'"\', "\'");\n    $chunk: str-replace($chunk, "%", "%25");\n    $chunk: str-replace($chunk, "#", "%23");\n    $chunk: str-replace($chunk, "{", "%7B");\n    $chunk: str-replace($chunk, "}", "%7D");\n    $chunk: str-replace($chunk, "<", "%3C");\n    $chunk: str-replace($chunk, ">", "%3E");\n\n    $encoded: #{$encoded}#{$chunk};\n    $index: $index + $slice;\n  }\n\n  @return url("data:image/svg+xml,#{$encoded}");\n}\n','/*!\n * Copyright (c) 2018-present, Okta, Inc. and/or its affiliates. All rights reserved.\n * The Okta software accompanied by this notice is provided pursuant to the Apache License, Version 2.0 (the "License.")\n *\n * You may obtain a copy of the License at http://www.apache.org/licenses/LICENSE-2.0.\n * Unless required by applicable law or agreed to in writing, software\n * distributed under the License is distributed on an "AS IS" BASIS, WITHOUT\n * WARRANTIES OR CONDITIONS OF ANY KIND, either express or implied.\n *\n * See the License for the specific language governing permissions and limitations under the License.\n */\n\n// Catch-all border-box bad boy\n\n* {\n  box-sizing: border-box;\n\n  &::before,\n  &::after {\n    box-sizing: inherit;\n  }\n}\n\n// Huge selector list layout reset\n\nhtml,\nbody,\ndiv,\nspan,\napplet,\nobject,\niframe,\nh1,\nh2,\nh3,\nh4,\nh5,\nh6,\np,\nblockquote,\npre,\na,\nabbr,\nacronym,\naddress,\nbig,\ncite,\ncode,\ndel,\ndfn,\nem,\nimg,\nins,\nkbd,\nq,\ns,\nsamp,\nsmall,\nstrike,\nstrong,\nsub,\nsup,\ntt,\nvar,\nb,\nu,\ni,\ncenter,\ndl,\ndt,\ndd,\nol,\nul,\nli,\nfieldset,\nform,\nlabel,\nlegend,\ntable,\ncaption,\ntbody,\ntfoot,\nthead,\ntr,\nth,\ntd,\narticle,\naside,\ncanvas,\ndetails,\nembed,\nfigure,\nfigcaption,\nfooter,\nheader,\nhgroup,\nmenu,\nnav,\noutput,\nruby,\nsection,\nsummary,\ntime,\nmark,\naudio,\nvideo {\n  margin-block: 0;\n  margin-inline: 0;\n  padding-block: 0;\n  padding-inline: 0;\n  border: 0;\n  font: inherit;\n  font-size: 100%;\n  vertical-align: baseline;\n}\n\nbutton,\ninput {\n  font: inherit;\n  font-size: 100%;\n}\n\n// HTML5 display-role reset for older browsers\n\narticle,\naside,\ndetails,\nfigcaption,\nfigure,\nfooter,\nheader,\nhgroup,\nmenu,\nnav,\nsection {\n  display: block;\n}\n\n// Element Specific Resets\n\nimg,\nsvg {\n  max-width: 100%;\n}\n\nol,\nul {\n  list-style: none;\n}\n\nblockquote,\nq {\n  quotes: none;\n\n  &::before,\n  &::after {\n    content: "";\n    content: none;\n  }\n}\n\ntable {\n  border-spacing: 0;\n  border-collapse: collapse;\n}\n','/*!\n * Copyright (c) 2018-present, Okta, Inc. and/or its affiliates. All rights reserved.\n * The Okta software accompanied by this notice is provided pursuant to the Apache License, Version 2.0 (the "License.")\n *\n * You may obtain a copy of the License at http://www.apache.org/licenses/LICENSE-2.0.\n * Unless required by applicable law or agreed to in writing, software\n * distributed under the License is distributed on an "AS IS" BASIS, WITHOUT\n * WARRANTIES OR CONDITIONS OF ANY KIND, either express or implied.\n *\n * See the License for the specific language governing permissions and limitations under the License.\n */\n\n// Rem-based modular scale for type\n// Not ready for general use.\n\n// Visually Hidden - use this for text that should be hidden from sighted\n// users, but available to ATs.\n\n.u-visually-hidden {\n  @include is-visually-hidden;\n}\n','/*!\n * Copyright (c) 2018-present, Okta, Inc. and/or its affiliates. All rights reserved.\n * The Okta software accompanied by this notice is provided pursuant to the Apache License, Version 2.0 (the "License.")\n *\n * You may obtain a copy of the License at http://www.apache.org/licenses/LICENSE-2.0.\n * Unless required by applicable law or agreed to in writing, software\n * distributed under the License is distributed on an "AS IS" BASIS, WITHOUT\n * WARRANTIES OR CONDITIONS OF ANY KIND, either express or implied.\n *\n * See the License for the specific language governing permissions and limitations under the License.\n */\n\n@mixin is-visually-hidden {\n  position: absolute;\n  width: 1px;\n  height: 1px;\n  margin-block: -1px;\n  margin-inline: -1px;\n  padding-block: 0;\n  padding-inline: 0;\n  overflow: hidden;\n  clip: rect(0 0 0 0);\n  border: 0;\n}\n\n/* stylelint-disable liberty/use-logical-spec */\n\n@mixin border-radius(\n  $all,\n  $top-right: $all,\n  $bottom-right: $all,\n  $bottom-left: $all,\n  $top-left: $all\n) {\n  border-start-start-radius: $top-left;\n  border-start-end-radius: $top-right;\n  border-end-end-radius: $bottom-right;\n  border-end-start-radius: $bottom-left;\n\n  @supports not (border-end-end-radius: 1px) {\n    border-top-left-radius: $top-left;\n    border-top-right-radius: $top-right;\n    border-bottom-right-radius: $bottom-right;\n    border-bottom-left-radius: $bottom-left;\n\n    [dir="rtl"] & {\n      border-top-left-radius: $top-right;\n      border-top-right-radius: $top-left;\n      border-bottom-right-radius: $bottom-left;\n      border-bottom-left-radius: $bottom-right;\n    }\n  }\n}\n\n/* stylelint-enable liberty/use-logical-spec */\n\n@mixin outline($outline-cv: $focus-ring-primary, $radius: 4px) {\n  outline: 0;\n  box-shadow: 0 0 0 $radius $outline-cv;\n}\n\n/* stylelint-disable no-descending-specificity */\n\n@mixin input-baseline {\n  @include border-radius($base-border-radius);\n\n  display: block;\n  position: relative;\n  width: 100%;\n  max-width: $max-line-length;\n  margin-block: 0;\n  margin-inline: 0;\n  padding-block: $spacing-xs-em;\n  padding-inline: $spacing-s-em;\n  transition-property: border-color, background-color, box-shadow;\n  transition-duration: $base-duration;\n  transition-timing-function: $base-timing;\n  border: 1px solid $border-color-ui;\n  background-color: $white;\n  box-shadow: 0 0 0 0 cv("blue", "000");\n  color: $text-body;\n  font-family: $body-font-family;\n  font-size: $size-body-base;\n  line-height: $base-line-height;\n\n  &:hover,\n  &:focus,\n  &.is-ods-input-hover,\n  &.is-ods-input-focus {\n    border-color: cv("blue");\n  }\n\n  &:focus,\n  &.is-ods-input-focus {\n    @include outline;\n  }\n\n  &:disabled {\n    opacity: 1;\n    color: $text-body;\n    cursor: not-allowed;\n  }\n\n  &:disabled,\n  &[readonly] {\n    border-color: $border-input-disabled;\n    background-color: $bg-input-disabled;\n\n    &:hover {\n      border-color: $border-input-disabled;\n    }\n  }\n\n  &:invalid,\n  &.is-ods-input-invalid {\n    border-color: $color-danger-base;\n\n    &:focus {\n      @include outline($focus-ring-danger);\n    }\n  }\n\n  &::placeholder {\n    color: $text-sub;\n  }\n}\n','/*!\n * Copyright (c) 2018-present, Okta, Inc. and/or its affiliates. All rights reserved.\n * The Okta software accompanied by this notice is provided pursuant to the Apache License, Version 2.0 (the "License.")\n *\n * You may obtain a copy of the License at http://www.apache.org/licenses/LICENSE-2.0.\n * Unless required by applicable law or agreed to in writing, software\n * distributed under the License is distributed on an "AS IS" BASIS, WITHOUT\n * WARRANTIES OR CONDITIONS OF ANY KIND, either express or implied.\n *\n * See the License for the specific language governing permissions and limitations under the License.\n */\n\n.ods-icon {\n  position: relative;\n  inset-block-start: -0.05em;\n  width: 1em;\n  height: 1em;\n  vertical-align: middle;\n\n  // Prelim RTL styles\n  .ods-rtl & {\n    order: 1;\n  }\n}\n','/*!\n * Copyright (c) 2018-present, Okta, Inc. and/or its affiliates. All rights reserved.\n * The Okta software accompanied by this notice is provided pursuant to the Apache License, Version 2.0 (the "License.")\n *\n * You may obtain a copy of the License at http://www.apache.org/licenses/LICENSE-2.0.\n * Unless required by applicable law or agreed to in writing, software\n * distributed under the License is distributed on an "AS IS" BASIS, WITHOUT\n * WARRANTIES OR CONDITIONS OF ANY KIND, either express or implied.\n *\n * See the License for the specific language governing permissions and limitations under the License.\n */\n\n@use "sass:math";\n\nhtml {\n  font-size: math.div($base-font-size, 16px) * 100%; // converts px value to % of browser default\n}\n\nbody {\n  color: $text-body;\n  font-family: $body-font-family;\n  font-style: normal;\n  font-weight: 400;\n  letter-spacing: 0;\n  line-height: $base-line-height;\n  font-feature-settings: "lnum", "pnum";\n  text-decoration-skip-ink: all;\n}\n','/*!\n * Copyright (c) 2018-present, Okta, Inc. and/or its affiliates. All rights reserved.\n * The Okta software accompanied by this notice is provided pursuant to the Apache License, Version 2.0 (the "License.")\n *\n * You may obtain a copy of the License at http://www.apache.org/licenses/LICENSE-2.0.\n * Unless required by applicable law or agreed to in writing, software\n * distributed under the License is distributed on an "AS IS" BASIS, WITHOUT\n * WARRANTIES OR CONDITIONS OF ANY KIND, either express or implied.\n *\n * See t